const initialState = {
    isLogged: false,
    first_name:"123",
    last_name:"",
    email:"",
    password:""
}

export default(state = initialState,action)=>{
    const {user} = state;
    const {payload} = action;
    switch (action.type){
        case 'ADD_USER':
            return {...user,user:payload}
        case 'LOG':
            return {...state,isLogged:payload}
        case 'CHANGE_USER':
            return {...user,user:payload}
        case "REQUEST":
            return state;
        default: return state
    }
}
